css:
:host(.vim-mode.command-mode) .cursor,
:host(.vim-mode.operator-pending-mode) .cursor,
:host(.vim-mode.visual-mode) .cursor,
atom-text-editor.vim-mode.command-mode .cursor,
atom-text-editor.vim-mode.operator-pending-mode .cursor,
atom-text-editor.vim-mode.visual-mode .cursor,
:host(.vim-mode.command-mode) .cursor.blink-off,
:host(.vim-mode.operator-pending-mode) .cursor.blink-off,
:host(.vim-mode.visual-mode) .cursor.blink-off,
atom-text-editor.vim-mode.command-mode .cursor.blink-off,
atom-text-editor.vim-mode.operator-pending-mode .cursor.blink-off,
atom-text-editor.vim-mode.visual-mode .cursor.blink-off {
  border: 0;
  background-color: #1d1f21;
  visibility: hidden;
  opacity: 0.5;
}
:host(.vim-mode.command-mode.is-focused) .cursor,
:host(.vim-mode.operator-pending-mode.is-focused) .cursor,
:host(.vim-mode.visual-mode.is-focused) .cursor,
atom-text-editor.vim-mode.command-mode.is-focused .cursor,
atom-text-editor.vim-mode.operator-pending-mode.is-focused .cursor,
atom-text-editor.vim-mode.visual-mode.is-focused .cursor,
:host(.vim-mode.command-mode.is-focused) .cursor.blink-off,
:host(.vim-mode.operator-pending-mode.is-focused) .cursor.blink-off,
:host(.vim-mode.visual-mode.is-focused) .cursor.blink-off,
atom-text-editor.vim-mode.command-mode.is-focused .cursor.blink-off,
atom-text-editor.vim-mode.operator-pending-mode.is-focused .cursor.blink-off,
atom-text-editor.vim-mode.visual-mode.is-focused .cursor.blink-off {
  border: 0;
  background-color: #1d1f21;
  visibility: visible;
  opacity: 0.5;
}
:host(.vim-mode.visual-mode) .cursor.hidden-cursor,
atom-text-editor.vim-mode.visual-mode .cursor.hidden-cursor {
  display: block;
}
